import React from 'react';

function Contact() {
  return (
    <div className="Contact">
        <p className="homeParagraph">I'm not too worried about email scrapers at the moment so feel free to contact me at jonathanmichael5150@gmail.com. A contact form is in progress for this page.'.</p>
    </div>
  );
}

export default Contact;
